// src/components/HomePage.jsx
import React from 'react';
import { Link } from 'react-router-dom';  // Importing Link to create navigation buttons

const HomePage = () => {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Welcome to the Ticketing App</h1>
      <div style={{ margin: '20px 0' }}>
        <Link to="/service-request">
          <button style={{ padding: '10px 20px', margin: '10px' }}>Service Request</button>
        </Link>
        <Link to="/problem-management">
          <button style={{ padding: '10px 20px', margin: '10px' }}>Problem Management</button>
        </Link>
        <Link to="/incident-management">
          <button style={{ padding: '10px 20px', margin: '10px' }}>Incident Management</button>
        </Link>
        <Link to="/change-management">
          <button style={{ padding: '10px 20px', margin: '10px' }}>Change Management</button>
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
